    data and is the most complete layer available at this time. The transportation routes
    within the boundary of Cedar Breaks were positioned more correctly with the help
    of the 2002 aerial photography. The Dixie National Forest gave Sandy White the permission
    to do with the data what she needed. Cedar Breaks' metadata is found following after
    any metadata created by the Dixie National Forest. The Dixie National Forest will
